description:
Spanje
Horror
85 minuten

een goeie film

met Manuela Velasco, Vicente Gil en Ferran Terraza

Een jonge tv-journaliste en haar cameraman lopen mee met de lokale brandweer. Op een nacht moet de brandweer een oude vrouw 
redden, die in een appartementengebouw vast lijkt te zitten. Maar wat in eerste instantie op een doodnormale routineklus lijkt, 
begint langzamerhand te veranderen in een gruwelijke en duistere nachtmerrie.
